import React from "react";
import * as S from "./styled";
export default function InputZipCode({ btntext, icon, ...rest }) {
  if (btntext) {
    <S.WrapInputZip>
      <S.Input {...rest} />
      <S.WrapInputBtn>
        <S.Btn>
          <span>{btntext}</span>
          <S.Circle>
            <img src={icon} alt="icon" />
          </S.Circle>
        </S.Btn>
      </S.WrapInputBtn>
    </S.WrapInputZip>;
  }

  return (
    <S.WrapInputZip>
      <S.Input {...rest} />
      <S.WrapInputBtn></S.WrapInputBtn>
    </S.WrapInputZip>
  );
}
